good.proto.protoContent:
syntax = "proto3";

option go_package = "rpc/api/pbentity";

package pb;

// ------------------------------------ 
// Messages
// ------------------------------------ 

//--------------------------------good--------------------------------
message Good {
  int64 id = 1; //id
  string goodName = 2; //商品名称
  string goodDes = 3; //商品介绍
  int64 userId = 4; //所属用户id
  int64 createdTime = 5; //创建日期
}

message AddGoodReq {
  string goodName = 1; //商品名称
  string goodDes = 2; //商品介绍
  int64 userId = 3; //所属用户id
  int64 createdTime = 4; //创建日期
}

message AddGoodResp {
}

message UpdateGoodReq {
  int64 id = 1; //id
  string goodName = 2; //商品名称
  string goodDes = 3; //商品介绍
  int64 userId = 4; //所属用户id
  int64 createdTime = 5; //创建日期
}

message UpdateGoodResp {
}

message DelGoodReq {
  int64 id = 1; //id
}

message DelGoodResp {
}

message GetGoodByIdReq {
  int64 id = 1; //id
}

message GetGoodByIdResp {
  Good good = 1; //good
}

message SearchGoodReq {
  int64 page = 1; //page
  int64 limit = 2; //limit
  int64 id = 3; //id
  string goodName = 4; //商品名称
  string goodDes = 5; //商品介绍
  int64 userId = 6; //所属用户id
  int64 createdTime = 7; //创建日期
}

message SearchGoodResp {
  repeated Good good = 1; //good
}

// ------------------------------------ 
// Rpc Func
// ------------------------------------ 

service good{

	 //-----------------------good----------------------- 
	 rpc AddGood(AddGoodReq) returns (AddGoodResp); 
	 rpc UpdateGood(UpdateGoodReq) returns (UpdateGoodResp); 
	 rpc DelGood(DelGoodReq) returns (DelGoodResp); 
	 rpc GetGoodById(GetGoodByIdReq) returns (GetGoodByIdResp); 
	 rpc SearchGood(SearchGoodReq) returns (SearchGoodResp);

}
